import "./App.css";
import Home from "./Components/Home/Home";
import { BrowserRouter, Switch, Route } from "react-router-dom";
function App() {
  return (
    <BrowserRouter>
      <Switch>
        <Route exact path="/home/" component={Home} />
      </Switch>
    </BrowserRouter>
  );
}

export default App;
